import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  justify-content: center;
`;

export const Text = styled.p`
  font-size: 18px;
  font-weight: 500;
  line-height: 25px;
  margin: 1em;
  text-align: center;
  width: 320px;
`;
